/*global chrome*/
import React, { Component } from "react";
import SignUp from "./components/SignUp";
import LogIn from "./components/LogIn";
import BlockedCategories from "./components/BlockCategories";
import ForgotPassword from "./components/ForgotPassword";
import Welcome from "./components/Welcome";
import { createMemoryHistory } from "history";

class App extends Component {
  state = {
    page: "LogIn"
  };

  handlePages = pageTitle => {
    this.setState({
      page: pageTitle
    });
  };

  render() {
    switch (this.state.page) {
      case "LogIn":
        return <LogIn changePage={this.handlePages} />;
      case "SignUp":
        return <SignUp changePage={this.handlePages} />;
      case "ForgotPassword":
        return <ForgotPassword changePage={this.handlePages} />;
      case "Welcome":
        return <Welcome changePage={this.handlePages} />;
      case "BlockedCategories":
        return <BlockedCategories changePage={this.handlePages} />;
      default:
        return <LogIn changePage={this.handlePages} />;
    }
    return (
      <div className="container">
        <LogIn />
      </div>
    );
  }
}

// export default App;

// function App() {

// }

export default App;
